  return (<>
   <AppBar>
    <Toolbar>
        <Box width={"20%"}><MovieIcon/></Box>
        <Box width={"50%"} margin={"auto"}> 
        <Autocomplete id="free-solo-demo" freeSolo options={top100Films.map((option) => option.title)} renderInput={(params) => <TextField {...params} label="freeSolo" />}/>      </Box>
    </Toolbar>
    </AppBar>
    </>
  )
}

